			runOnlyForDeploymentPostprocessing = 0;
			shellPath = /bin/sh;
			shellScript = "BUILDROOT=AranymOSX\nDMG=./Aranym-MACOSX-${CURRENT_PROJECT_VERSION}.dmg\ncd $PWD\n\n# remove any leftovers from previous image creation.\necho \"-- Removing leftovers from previous runs\"\nrm -rf ${BUILDROOT} ${BUILDROOT}.dmg ${DMG}\n\n# make new buildroot directory\necho \"-- Making ${BUILDROOT} directory\"\nmkdir ${BUILDROOT}\nif test $? != 0; then \n  echo ERROR: mkdir ${BUILDROOT} or mkdir ${INSTALL_PREFIX} failed\n  exit 30\nfi\n#copying files in aratemp\necho -- copying needed files\ncp -v 'Disc image files/Install and setup.rtf' ${BUILDROOT}\ncp -R -v 'Disc image files/Aranym' ${BUILDROOT}\ncp -R -v 'build/MacAranym.app' ${BUILDROOT}/Aranym\ncp -R -v 'build/MacAranym MMU.app' ${BUILDROOT}/Aranym\n\n# make dirs\nmkdir -v ${BUILDROOT}/Aranym/doc ${BUILDROOT}/Aranym/atari ${BUILDROOT}/Aranym/atari/hostfs ${BUILDROOT}/Aranym/atari/nfcdrom ${BUILDROOT}/Aranym/atari/network ${BUILDROOT}/Aranym/atari/fvdi ${BUILDROOT}/Aranym/atari/tools ${BUILDROOT}/Aranym/atari/sound\n\ncp -v ../../ChangeLog ${BUILDROOT}/Aranym/doc\ncp -v ../../TODO ${BUILDROOT}/Aranym/doc\ncp -v ../../AUTHORS ${BUILDROOT}/Aranym/doc\ncp -v ../../NEWS ${BUILDROOT}/Aranym/doc\ncp -v ../../README ${BUILDROOT}/Aranym/doc\ncp -v ../../FAQ ${BUILDROOT}/Aranym/doc\ncp -v ../../COPYING ${BUILDROOT}/Aranym/doc\ncp -v ../../BUGS ${BUILDROOT}/Aranym/doc\ncp -v ../../INSTALL ${BUILDROOT}/Aranym/doc\t\ncp -v ../../doc/documentation.txt ${BUILDROOT}/Aranym/doc\ncp -v ../../atari/newdesk.inf ${BUILDROOT}/Aranym/atari/\ncp -v ../../atari/mmusetup.cnf ${BUILDROOT}/Aranym/atari/\ncp -v ../../atari/hostfs/bin/hostfs.dos.bz2 ${BUILDROOT}/Aranym/atari/hostfs/\ncp -v ../../atari/hostfs/bin/hostfs.xfs.bz2 ${BUILDROOT}/Aranym/atari/hostfs/\ncp -v ../../atari/nfcdrom/nfcdrom.bos.bz2 ${BUILDROOT}/Aranym/atari/nfcdrom/\ncp -v ../../atari/nfjpeg/nfjpeg.prg.bz2 ${BUILDROOT}/Aranym/atari/nfjpeg/\ncp -v ../../atari/nfosmesa/osmesa.ldg.bz2 ${BUILDROOT}/Aranym/atari/nfosmesa/\ncp -v ../../atari/hostfs/bdconfig.sys ${BUILDROOT}/Aranym/atari/hostfs/\ncp -v ../../atari/hostfs/bdconfig.sys ${BUILDROOT}/Aranym/atari/hostfs/\ncp -v ../../atari/hostfs/README ${BUILDROOT}/Aranym/atari/hostfs/\n#cp -v ../../atari/network/ethernet/bin/aranym.xif.bz2 ${BUILDROOT}/Aranym/atari/network/\n#cp -v ../../atari/network/ethernet/nfeth-config/nfeth-config.bz2 ${BUILDROOT}/Aranym/atari/network/\n#cp -v ../../atari/network/ethernet/nfeth-config/eth0-config.sh ${BUILDROOT}/Aranym/atari/network/\n#cp -v ../../atari/network/ethernet/README ${BUILDROOT}/Aranym/atari/network/\n#cp -v ../../tools/arabridge ${BUILDROOT}/Aranym/\ncp -v ../../tools/floppy.sh ${BUILDROOT}/Aranym/atari/tools\ncp -v ../../atari/fvdi/drivers/aranym.sys.bz2 ${BUILDROOT}/Aranym/atari/fvdi/\ncp -v ../../atari/fvdi/fvdi.prg.bz2 ${BUILDROOT}/Aranym/atari/fvdi/\ncp -v ../../atari/fvdi/fvdi.sys ${BUILDROOT}/Aranym/atari/fvdi/\ncp -v ../../atari/tools/README ${BUILDROOT}/Aranym/atari/tools/\ncp -v ../../atari/tools/clocky.prg.bz2 ${BUILDROOT}/Aranym/atari/tools/\ncp -v ../../atari/tools/pc101us.kbd.bz2 ${BUILDROOT}/Aranym/atari/tools/\ncp -v ../../atari/tools/pcpatch.prg.bz2 ${BUILDROOT}/Aranym/atari/tools/\ncp -v ../../atari/sound/zmagxsnd.prg.bz2 ${BUILDROOT}/Aranym/atari/sound/\ncp -v ../../atari/sound/README ${BUILDROOT}/Aranym/atari/sound/\n\n# create new disk image\necho \"-- Making a disk image with root at ${BUILDROOT}, using diskimage.pl\"\n./diskimage.pl ${BUILDROOT}\nif test $? != 0; then\n  echo ERROR: diskimage.pl script failed\n  exit 60\nfi\n\nif test ! -f ${BUILDROOT}.dmg; then\n  echo ERROR: diskimage.pl succeeded but I cannot find the image ${BUILDROOT}.dmg.\n  exit 70\nfi\n\n# rename to the right thing\necho \"-- Renaming the output disk image to ${DMG}\"\nmv ${BUILDROOT}.dmg ${DMG}\nif test $? != 0; then\n  echo ERROR: rename failed\n  exit 80\nfi\n\necho \"-- Done!  The final disk image is \"\nls -l ${DMG}\n\necho \"-- Cleaning up the temporary files in ${BUILDROOT}\"\nrm -rf ${BUILDROOT}\n\nexit 0\n";
